function getIndexOfPhoneme(phon){
	for(var phonemePosition = 0; phonemePosition < phonemeArray.phonemes.length; phonemePosition++){
		if(phon === phonemeArray.phonemes[phonemePosition].words[0].p){
			return phonemePosition;
		}
 	}
 	return phon + " " + phonemeArray.phonemes.length + " " + phonemePosition;
 
 }
 
/**
 * Randomize array element order in-place.
 * Using Durstenfeld shuffle algorithm.
 */
function shuffleArray(array) {
    for (var i = array.length - 1; i > 0; i--) {
        var j = Math.floor(Math.random() * (i + 1));
        var temp = array[i];
        array[i] = array[j];
        array[j] = temp;
    }
}

 
